Uma obra destinada a proporcionar melhores informações para que os profissionais que atuam em trabalhos de atividades físicas para gestantes possam obter o êxito. 

Preocupada com isto, a autora Érica Verderi, trata em 5 capítulos de temas como as Considerações do Período Gestacional, com um passo-a-passo das semanas de gestação com o desenvolvimento do bebê, Exercícios e Gestação, que trazem as questões físicas e psicológicas sendo trabalhadas para uma harmonia gestacional que beneficia mãe e bebê, Exercícios Pós-Parto, explicando melhor o período do puerpério, Sugestão de Programa de Exercício e Sugestões para a Gestante, sempre propondo uma renovação nos métodos de desenvolver programas de exercícios para pessoas em condições especiais.

- Considerações sobre o período Gestacional; 
- Exercícios e Gestação; 
- Exercícios Pós-Parto; 
- Sugestão de Formulário para o Programa de Exercícios; 
- Orientação à Gestante; 

Autor:
Érica Beatriz Lemes Pimentel Verderi

Software desenvolvido em parceria com o Prof. Roberto Costa, que auxiliar o profissional fazer a melhor Avaliação da Composição Corporal.

O Software é composto por módulos completos de cálculos: 

* Pesagem Hidrostática - Cálculo do percentual de gordura corporal e etc;

* Bioimpedância - Protocolos específicos para cada grupo – Criança e Adolescentes, Adultos, Obesos, Atletas e até Atletas Universitários;

* Antropometria - Cálculo de IMC e ICQ;

* Equações Preditivas - Genéricas e específicas para cada população – Adultos, Crianças e Adolescentes, Universitários, Idosos, Atletas e Obesos;

* Editor de Fórmulas - Permite ao profissional cadastrar novas equações que melhor atendam suas necessidades para Antropometria ou Bioimpedância;

* Comparativos - Comparação entre avaliações já realizadas, resultados que podem ser impressos em forma de tabela e/ou gráfico, 

Ferramenta que gera qualidade e resultado no trabalho de Avaliação da Composição Corporal.

